import React from "react";
import './Contenido_Archivos.css'

class Contenido_Archivos extends React.Component {
    render() {
        return (
            <div id="div">
                <div id='divruta'>
                    <div id='divrutas'>
                        <img id="iconos" src='/img/icono_inicio.png' alt='' />
                        <text id='textrutas'>Inicio/</text>
                        <img id="iconos" src='/img/icono_instituciones.png' alt='' />
                        <text id='textrutas'>Instituciones</text>
                    </div>
                </div>
                <hr />

                <div id='selector'>
                    <text>Departamento*</text>
                    <select id='seleccionar' class="form-select">
                        <option>Selecione una Opci√≥n</option>
                    </select>
                </div>
            </div>
        )
    }
}
export default Contenido_Archivos;
